const ActivityCreate = () => {
  const dispatch = useDispatch();
  const activities = useSelector((state) => state.activities);

  const [input, setInput] = useState({
    name: "",
    difficulty: "",
    duration: 0,
    season: "",
    countryId: [],
  });
};

